<script>
	import {
		mapState
	} from 'vuex';
	export default {
		data() {
			return {
				showContact: false,
				showDevNav: false,
				rede_code: '',
				loginCode: "",
				nickName: "",
				userId: "",
				wxAvatar: "",
				openId: "",
			};
		},
		computed: {

		},
		onLoad() {
			const userInfo = uni.getStorageSync('userInfo');
			this.nickName = userInfo.nickName
			this.userId = userInfo.userId
			this.openId = userInfo.openid
			this.wxAvatar = userInfo.wxAvatar
		},
		onShareAppMessage() {
			return {
				title: '快来和胖胖聊天呀',
				path: '/pages/index/home?share_m_id=' + this.userInfo.nickName,
				imageUrl: 'https://s1.ax1x.com/2023/03/19/ppYVZRK.jpg'
			}
		},
		methods: {
			toVip() {
				uni.navigateTo({
					url: "/pages/vip/vip"
				})
			},
			navTo(id) {
				switch (id) {
					case "help":
						uni.navigateTo({
							url: '/pages/content/help'
						})
						break;
				}
			},
			showContactPop() {
				this.showContact ? this.showContact = false : this.showContact = true;
			},
			call() {
				uni.makePhoneCall({
					phoneNumber: '010-86203046'
				})
			},
			getProfile(e) {
				this.$refs.getUserProfile.open({
					desc: '授权登录',
					success: e => {
						console.log(e)
						// 更新用户信息
						this.$request('/system/user/edit/xcxUser', 'POST', {
							userId: this.userId,
							nickName: e.userInfo.nickName,
							wxAvatar: e.userInfo.avatarUrl,
							openId: this.openId
						}, {
							'content-type': 'application/json'
						}).then(res => {
							if (res.code == 200) {
								// 更新缓存
								uni.setStorageSync('userInfo', res.data)
								uni.redirectTo({
									url: "/pages/mine/mine"
								})
							}
						})
					},
					fail: err => {
						console.log(err)
					}
				});
			},
			rede() {
				this.$refs.popup.open()
			},
			dialogInputConfirm(val) {
				if (!val) {
					uni.showModal({
						content: "请输入兑换码！"
					});
					return
				}
				uni.showLoading({
					title: '兑换中...'
				})
				this.$request('/api/Redemption/rede', 'POST', {
					code: val
				}).then(res => {
					console.log(res)
					if (res.status == 200) {
						this.$refs.inputClose.close()
						uni.hideLoading()
						uni.showModal({
							content: "已兑换成功"
						})
						this.rede_code = ""
						this.$store.commit('syncUserNum', res.data.num)
					} else {
						this.$refs.inputClose.close()
						uni.hideLoading()
						uni.showModal({
							content: res.status == 201 ? res.msg : '核销失败'
						})
					}
				})
			},
			logout() {
				uni.removeStorageSync('userInfo')
				uni.removeStorageSync('token')
				this.$request("/login/logout", "Post").then((res) => {
					if (res.code == 200) {
						uni.reLaunch({
							url: "../index/home"
						})
					} else {
						this.$failToast('服务器繁忙，请稍后再试');
					}
				});

			}
		},
	};
</script>

